import React from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  const handleLogout = () => {
    localStorage.removeItem('user');
    window.location.reload(); // Reload the app to trigger re-login
  };

  return (
    <div className="dashboard">
      <h1>Welcome to the Dashboard</h1>
      <nav>
        <ul>
          <li><Link to="/new-survey">Start a New Survey</Link></li>
          <li><Link to="/treatment-plan">View Treatment Plan</Link></li>
          <li><Link to="/current-diagnosis">View Current Diagnosis</Link></li>
        </ul>
      </nav>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
}

export default Dashboard;
